import React, { Component } from 'react'

export default class App extends Component {
  constructor(){
    super()
    this.state={
      style:{
        colorr:"#fff000"
      }
    }
  }

  render() {
    return (
      <div>
        <h1 style={this.state.colorr} >hello world</h1>
      </div>
    )
  }
}
